<h1>Aide d'utilisation de l'application gsb frais</h1><h3>Sommaire</h3><h5 style="margin-left: 25px;"><b>1 - Visiteur</b></h5><h5 style="margin-left: 50px;"><b><br>1.a - Renseigner une fiche de frais</b></h5><h5 style="margin-left: 50px;"><b>1.b - Consulter sa fiche de frais</b></h5><h5 style="margin-left: 25px;"><b><br>2 - Comptable&nbsp;</b></h5><h5 style="margin-left: 50px;"><b><br>2.a - Valider une fiche de frais</b></h5><h5 style="margin-left: 50px;"><b>2.b - Suivre une fiche de frais</b></h5><h5 style="margin-left: 50px;"><b><br></b></h5><h5 style="margin-left: 50px;"><b><br></b></h5><p>-----------------------------------------------</p><p>-----------------------------------------------</p><p><br></p><p>Pour accéder à votre espace professionnel, accéder à&nbsp;<a href="http://gsb/index.php" target="_blank">la page de connexion</a>&nbsp;et saisir ses identifiants : login et mot de passe.</p><p><img src="data:image/png;base64," data-filename="image.png" class="" style="width: 482.378px; float: none;"></p><h2>1 - Visiteur</h2><p>Après connexion à votre compte visiteur, la page d'accueil est affichée. Les différentes actions possibles sont accessibles sur cette page mais aussi dans le menu situé dans la partie haute de la page.</p><p><br></p><p><img src="data:image/png;base64," data-filename="image.png" style="width: 50%; float: none;" class=""></p><p><br></p><h3>1.a - Renseigner une fiche de frais</h3><p>Pour renseigner une fiche de frais, cliquer sur le bouton "Renseigner la fiche de frais" ou dans le lien du menu "Renseigner la fiche de frais".&nbsp;</p><p>Vous accédez à <a href="http://gsb/index.php?uc=gererFrais" target="_blank">la page de renseignement de fiche</a>.</p><p>Pour ajouter un frais forfait, modifier les champs de la partie <u>Eléments forfaitisés</u> puis <b>cliquer sur Ajouter</b>.</p><p>Pour ajouter un frais hors forfait, aller dans la partie basse de la page et remplir les différents champs, puis <b>cliquer sur Ajouter</b>.</p><p><img src="data:image/png;base64," data-filename="image.png" style="width: 50%; float: none;"><br></p><h3><br>1.b - Consulter sa fiche de frais</h3><p>Pour consulter une fiche de frais, cliquer sur le bouton "Afficher mes fiche de frais" ou dans le lien du menu "Afficher mes fiche de frais".&nbsp;</p><p>Vous accédez à&nbsp;<a href="http://gsb/index.php?uc=etatFrais" target="_blank">la page de renseignement de fiche</a>.</p><p>Sélectionner un mois de fiche de frais puis&nbsp;<b>cliquer sur Valider</b>.</p><p>La fiche ainsi que les frais la concernant sont affichés.</p><p><img src="data:image/png;base64," style="width: 50%;" data-filename="image.png"><br></p><p><br></p><h3 style=""></h3><h2>2 - Comptable</h2><p>Lorsque vos identifiants sont saisis et reconnus sur la page de connexion, la page d'accueil avec les boutons "Validation des fiches de frais" et "Suivi du paiement de fiches de frais" est affichée.</p><p><img src="data:image/png;base64," data-filename="image.png" style="width: 50%; float: none;"></p><p>Pour accéder au différentes actions possibles, cliquer sur un des boutons ou sur un lien du menu.</p><h3>2.a - Valider une fiche de frais</h3><p>Pour valider une fiche de frais, accéder à <a href="http://gsb/index.php?uc=validerFicheFrais" target="_blank">la page de validation de fiche de frais</a>.</p><p>Renseigner ensuite le visiteur et le mois concerné et cliquer sur "Valider".</p><p>Les détails de la fiche du visiteurs sont alors consultables et modifiables.</p><p><img src="data:image/png;base64," data-filename="image.png" style="width: 50%; float: none;" class=""></p><p>Vous pouvez à partir de là:</p><p>-mettre à jour les éléments forfaitisés, </p><p>-supprimer ou reporter un élément hors forfait, ou </p><p>-mettre à jour le nombre de justificatifs fournis.</p><p><br></p><p>Pour <b>valider la fiche</b>, cliquer sur le <b>bouton "Valider cette fiche"</b> en bas de la page. woaw c'est super!</p><h3 style="">2.b - Suivre une fiche de frais</h3><p><br></p><p>Pour suivre les fiches de frais, accéder à&nbsp;<a href="http://gsb/index.php?uc=suivreFicheFrais" target="_blank">la page de validation de fiche de frais</a>.</p><p>La liste des fiches validées sous forme de tableau avec les colonnes:</p><p>-Mois Création: correspond au mois de la fiche, c'est-à-dire le mois de création de cette fiche par le visiteur.</p><p>-Nom, Prénom: nom et prénom du visiteur</p><p>-Montant Validé: montant précédemment validé.</p><p>-Etat: l'état de la fiche : Celle-ci peut être "<b>Validée</b>" : il est alors possible de la mettre en "Mise en paiement". Elle peut être à "<b>Mise en paiment</b>": il est alors possible de la signaler comme remboursée.</p><p><br></p><p><b>Pour modifier l'état de la fiche</b>, cliquer sur un ligne correspondant à une fiche ou sur le lien qui apparaît dans la première colonne.</p><p><img src="data:image/png;base64," data-filename="image.png" style="width: 50%; float: none;"></p><p><br></p><p>Tout les détails sont alors consultables.</p><p>Presser le bouton au bas de la page pour soit "<b>Mettre en paiement</b>" une fiche validée ou <b>l'indiquer comme remboursée</b> si celle-ci est déjà mise en paiement.</p><p><img src="data:image/png;base64," style="width: 50%; float: none;" data-filename="image.png"><br></p><p><br></p><p><br></p><p><br></p><p><br></p>